/* GENERATED FILE */
import * as React from 'react';
import Svg, { Rect, Circle } from 'react-native-svg';

import { IconProps } from '../lib';

function Calculator(props: IconProps) {
  return (
    <Svg
      viewBox="0 0 256 256"
      width={props.size}
      height={props.size}
      {...props}
    >
      <Rect width={256} height={256} fill="none" />
      <Rect
        x={80}
        y={64}
        width={96}
        height={48}
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={8}
      />
      <Rect
        x={32}
        y={48}
        width={192}
        height={160}
        rx={8}
        transform="translate(256) rotate(90)"
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={8}
      />
      <Circle cx={88} cy={148} r={8} fill={props.color} />
      <Circle cx={128} cy={148} r={8} fill={props.color} />
      <Circle cx={168} cy={148} r={8} fill={props.color} />
      <Circle cx={88} cy={188} r={8} fill={props.color} />
      <Circle cx={128} cy={188} r={8} fill={props.color} />
      <Circle cx={168} cy={188} r={8} fill={props.color} />
    </Svg>
  );
}

export default Calculator;
